import './style.css'
function Header() {
    return (
        <div className="header">
            <span class="label">
                EFOOD
            </span>

            <ul>
                <li className="active">Home</li>
                <li>Menu</li>
                <li>Service</li>
                <li>Contact</li>
            </ul>


        </div>

    );
}

export default Header;
